1509	UX week 2016	Hola! Estoy haciendo request para asistir a uno de los eventos más importantes de experiencia de usuario, UX Week en San Francisco. \n\n1. Schedule (registration, payment, training and travel)\nEl evento es del 9 al 12 de Agosto 2016. Lo ideal es que asistieramos 3 integrantes del equipo de UX. El costo es de $2,395 USD por persona con el early bird hasta el 31 de Marzo, después de esa fecha aplica el precio regular que es de $2,895 USD. Más info aquí\n\n2. Estimated costs \nTraining: $2,395 USD \nTransportation:  $460 USD ($400 vuelo desde Tucson + $60dlls translado HMO-Tucson)\nHotel:  $950 USD (5 noches habitación doble. $190 por noche Hotel cerca de cede)\nMeals: $350 USD ($60 USD diarios)\n\nTOTAL: $4,155 USD por persona aprox\n\n3. Answer to this question: Why do you think this training is related to the Client technology stack or to Nearsoft's strategy, or to your career roadmap?\nEl UX team tiene como objetivo ser parte de la estrategia de Nearsoft de alcanzar un Revenue más grande este año. Estamos trabajando para poder generar ganancias y ser un equipo auto-sustentable. Este evento está relacionado porque nos ayudará a que podamos estar en un nivel de expertise para poder ofrecer un servicio de calidad competente con las compañías más reconocidas de UX en Estados Unidos. \n\nSi asistimos a este evento los beneficios serían:\n- Experiencia en metodologías y mejores prácticas de UX para aplicar con nuestros clientes.\n\n- Herramientas para facilitar workshops, pláticas, dar asesorías y promover prácticas de UX para resolver problemas de usabilidad o de procesos en proyectos internos de Nearsoft. \n \n- Material competitivo y experiencia para poder ofrecer workshops a founders de compañías que tengan fit con Nearsoft y puedan ser nuestros clientes potenciales. \n\nAl regresar, nos compremeteríamos a facilitar nuevos Workshops de UX a la comunidad Nearsoft HMO, CDMX y CUU para compartir conocimiento y poner en práctica lo que aprendimos. Esto es muy importante tomando en cuenta que somos una empresa de desarrollo de software, tener cultura de planeación y desarrollo de UX en nuestros procesos beneficia nuestra productividad y mejora los productos con los que trabajamos.\n\nTambién está relacionado con mi career path pues uno de mis objetivos es ser experto en UX, y eso significa estar actualizada con mejores prácticas. Como parte de mi assessment me dieron la recomendación de tomar este tipo de trainings pues la experiencia les ha servido para su desarrollo profesional y confianza para facilitar platicas o workshops.\n\nGracias!	San Francisco	4320	2016-08-09 04:00:00	2016-08-12 15:00:00	APPROVED	https://groups.google.com/a/nearsoft.com/forum/#!topic/training-leadership-team/upe5_DWhOfg	2016-02-23 20:01:05.104	\N	172	1172	system	\N
