tterns\nIlya Grigorik, Web Performance Engineer at Google\n\nCSS for Software Engineers for CSS Developers\nHarry Roberts, Front-end Architecture and Performance Engineer\n\nVision, Hearing, & The Brain: The Top 10 Things You Need to Know about Perception\nSusan Weinschenk, Team W\n\nBeyond the browser (HTML-Based desktop apps)\nTom Giannattasio, Macaw \n\nLiving Design Systems\nJina Bolton, Salesforce\n\nCoherent Design Systems\nPatty Toland, Filament Group\n\nCommunity Creation\nJeff Atwood\n\n\n---\n\n\n¡Gracias!	San Francisco	1440	\N	\N	NOT_APPROVED	w	2016-03-07 17:27:25.369	\N	72	137	system	\N
