2962	CAT Certified Agile Tester Training	#Why do you think this training is related to the Client technology stack, to Nearsoft's strategy, or to your career roadmap?\n\nThis training is directly related to the Nearsoft Client technology stack as Agile approaches and methods have become increasingly important in the context of fast changing markets for our clients, as they reduce costs and improve customer collaboration. As a company that provides software as a service solutions it is crucial to offer the best and most efficient service that our clients require. \n\nFurthermore, the participants will be able to grow in their career roadmap, redefining their role by contributing positively as an agile team member, leading up to the application of adequate solutions in their projects; becoming better in their current role but also with the possibility of aspiring for other roles, such as Scrum Master, Success Coach, Agile Coach, etc. \n\n----------\nDuring 2014 and until early 2016, while doing field research for my thesis in MCC with Nearsoft as case study, I conducted interviews with team members from all of our clients. It was surprising to find out that most of them were not capable to identify from an Agile practices map the name of the practice they used in their daily work or while describing to me what kind of practices/processes they were implementing, they did not knew that those have a validated name in the industry. Using a common language in agile methods and practices is essential not only because it determines a consistent vision on how to do things, ensuring that global best practices are followed; it also allows sharing of experiences and finding solutions between teams and team members: how are we applying this technique​? How wrong we were about this concept​?  Now that we know the rules, how can ​we bend ​them in ways we can all understand?\n\nThe knowledge of how to keep a balance between time and quality plus the skill of finding risk and bugs earlier as possible are key abilities for a good tester. How can you achieve this? Not only by studying theory concepts but also by understanding when and how methodologies and practices should be applied. \n\nAfter we noticed the positive impact that iSTQB® Testing Foundation Level training had for our Quality Engineers (which was instructed during 2014) such as providing a common ground and effective communication resulting in a higher level of services, increasing the value of Nearsoft as a brand of high quality; we are sending this request as we believe iSQI® Certified Agile Tester training will benefit us by upscaling knowledge in Agile area, enhancing the effectiveness in performing testing activities in Agile projects not only for Test Practitioners, but as well for Scrum Masters, Developers or anyone moving to Agile. In addition, it will provide a clear idea on how each person in the project contributes back to the process, establishing these competencies to support the team’s accountability for quality.	\N	1920	2016-08-19 09:00:00	\N	APPROVED	\N	2016-07-08 22:27:24.986	2016-07-23 20:42:04.647	172	57	system	\N
