8888	Convocatoria iSQI's Certified Agile Tester Training (CAT) 2017	Convocatoria iSQI's Certified Agile Tester Training (CAT) 2017 \n\nBe AGILE! \n\nAgile is flexible and adaptive with frequent feedback loops, far different from the traditional regimented methodologies. It focuses on the most important element in agile projects: You!\nThe Certified Agile Tester training is designed to enable those with testing experience to become effective members of an Agile project. It provides structure and discipline as well as a common language and methods, ensuring global best practice is followed in Agile projects.\n\nYour Team Will Learn to\n- Understand the principles behind the agile approach to software development\n- Differentiate between the testing role in agile projects compared with the role of testers in non-agile projects\n- Positively contribute as an agile team member focused on testing\n- Appreciate the challenges and difficulties associated with the non-testing activities performed in an agile team\n- Demonstrate a range of soft skills required by agile team members\n\nThis Training is for\n- Software Testers, Scrum Masters and Developers wanting a better understanding of testing’s role in an Agile project.\n- Experienced Testers wanting to become valuable members of an Agile team.\n- Testers wanting to accredit their Agile skills for recognition among employers, clients and peers.\n\nPRE-REQUISITES \nTrainee should be familiar with the following topics: \n- Basic Testing Terminology\n- Understand the difference between functional and nonfunctional testing\n- Basic concepts of performance and usability testing. \n- All activities associated with fundamental test process. \n- Test Design.\n- 3 PTO days available. \n- English is a must, since material is in English :)\n\nDuration\nCourse: 4 days + Exam: 1 day\n\nDATES\nGroup still needs to decide which date is better for them. \n\n* October *\nThe course will be broken into 2 weeks as follows: \n\tWeek 1: Friday