8891	Slack Frontiers	What:\n\nhttps://slackfrontiers.com/\n\nFrontiers is an event focused on teamwork: how it is evolving, challenges and the future of it. From the page: "Finding better ways for teams to work together is one of the biggest challenges facing every company and industry. That’s why we’re introducing Frontiers: a two–day conference by Slack that brings together leading thinkers, Slack customers, developers, and partners to explore how the nature of teamwork is changing."\n\nArtemisa and I have been leading our teams for a few years now, applying techniques learnt from books, videos and the example of other leaders. Still, there’s a lot to learn, specially around:\n\n- Learn what drives our team members at work.\n- Help them build their career path.\n- Be more agile, adapting to our clients workflow.\n- Have meaningful 1:1s\n\nThis event sounds like a good place to learn, PLUS with the opportunity of show off our current products that have Slack integration. Sounds like the perfect place to do it: Slack users (maybe even power users) + devs + engineering leaders.\n\nAnd! This will also allow us to visit our clients in San Francisco for the rest of the week.\n\nTL;DR\n\nBenefits of attending:\n\n- Leadership training for Artemisa and I, aligned to our current roles in our teams.\n- Networking with other Engineering Leaders/Managers, who can become new partners.\n- Yes… we can also talk about LABS products, like Retrospectives or Planning with Cards. This is our niche after all, right?\n- 4 posts for marketing or NS Jobs.\n\nWhy should we BOTH attend: \n\nIn case you were wondering :) Artemisa and I are involved in leadership activities, not only regarding resourcing and stuff, but we also have 1:1s with our team members, we worry about their motivations and their goals. We are not required to do it, we just love to help out. \n\nRequested Budget in USD:\nConference Early Bird fee: $399 dollars ($798 dollars)\nFlights: $350 per person ($700 total)\nHotel: $998 (in SF)\nDowntime: Not required, client will pay/PTOs will be used\nPer diem (total): $400\n\nTotal: $2896	San Francisco, California	960	2017-09-12 07:00:00	2017-09-13 07:00:00	APPROVED	\N	2017-07-11 20:23:19.945	2017-08-07 17:53:56.368	125	57	jgarcia@nearsoft.com	ilopez@nearsoft.com
