7412	Grails: Fantastic features and where to find them	Grails is a Java Web Framework that help us reduce development time of web applications by using the Software Design Paradigm “Convention over Configuration”. It is a Groovy-based framework, which is a language for the JVM, if you are a ruby, python or Java developer most of the concepts will be easy to understand, Grails give you the required tools to start developing with almost none effort from the beginning, it also allows you to generate some components on the fly but giving you the opportunity to define or override the default behavior.\n\nThe objetive of this workshop is to give the developer a Java framework alternative, which has dynamic and static capabilities, reduce the effort during configuration of new projects, create demos or full projects compatible with the Java tools known, thus, increasing productivity and reducing development time.\n\nWhat am I going to learn?\n- The basics of Groovy language and how this is a perfect complement for Java\n- Basics of metaprogramming with Groovy\n- How to use your existing Java code and make it Groovier\n- An introduction to Grails framework and how it works\n- Basic REST with Grails framework	10	15	2017-03-23 20:00:00	1	4	Not defined yet.	120	100	t	WORKSHOP	\N	training-app@nearsoft.com	o1dfaqpn9vhb3qeoguvga897ng	2017-03-08 22:47:26.019161	2017-03-08 22:47:26.019161
