9149	Taller de Fundamentos para el Diseño de la Experiencia Interactiva - Pt 1	Fundamentos para el Diseño de la Experiencia Interactiva: Teorías y Principios de Psicología Cognitiva y Psicología Conductual\n\nDuración: 3 sesiones de 2 horas\n\nEn este taller corto se presentan una serie de teorías y principios para fundamentar el diseño de la experiencia interactiva con productos digitales (ej. páginas web, aplicaciones móviles). Se presentan ideas de percepción sensorial que definen nuestra capacidad de establecer estructura visual, manejo de vision central vs. visión periférica, y otros relacionados a ceguera al color. \n\nSe cubren temas de atención y capacidad de memoria a largo y corto plazo, así como aspectos de apreciación de aspectos temporales. Por otro lado se establecen también ideas para diseño a partir de modelos de psicología de la conducta. Se revisan la teoría del comportamiento planeado, modelos de motivación, influencia y persuasión. \n\nEl curso se imparte combinando modelos y teorías con ejemplos de aplicación para el diseño de experiencias interactivas. Los conocimientos que se presentan sirven para facilitar la comprensión y aplicación de lineamientos de diseño que presentan empresas como Apple, Microsoft o Google. \n\nAcerca del Tallerista: \nVíctor Manuel González (PhD, MSc, Cert. Eng) es un entusiasta, consultor y experto internacional en el campo de la interacción humano-computadora y el diseño de experiencias óptimas de usuario para productos interactivos. Es profesor de tiempo completo y jefe del Departamento Académico de Computación del Instituto Tecnológico Autónomo de México (ITAM). Combina su labor docente y de investigación, con el campo de la consultoría a través de la cual apoya a empresas en México y Latinoamérica a encontrar mejores métodos para diseñar, y crear productos digitales con propuestas de valor innovadoras.\n\nhttps://victormgonzalez.me/	32	32	2017-08-15 20:00:00	1	5	Not defined yet.	120	0	f	IN_PERSON_CLASS	9147	training-app@nearsoft.com	s2eoib2ban795hcv9d3tl4ftp0	2017-07-19 16:18:15.779244	2017-07-19 16:18:15.779244
