--
-- Name: accounts_balance_view; Type: MATERIALIZED VIEW; Schema: public; Owner: training
--

CREATE MATERIALIZED VIEW accounts_balance_view AS
 SELECT g.account_id,
    (sum(
        CASE
            WHEN ((g.transaction_type)::text = 'DEBIT'::text) THEN g.amount
            ELSE (0)::numeric
        END) - sum(
        CASE
            WHEN ((g.transaction_type)::text = 'CREDIT'::text) THEN g.amount
            ELSE (0)::numeric
        END)) AS current_balance,
    ( SELECT general_ledger.amount
           FROM general_ledger
          WHERE ((general_ledger.account_id = g.account_id) AND ((general_ledger.transaction_type)::text = 'BALANCE'::text))
          ORDER BY general_ledger.transaction_date DESC
         LIMIT 1) AS previous_balance
   FROM general_ledger g
  GROUP BY g.account_id
  WITH NO DATA;


